const Navbar = () => {
  const styles = {
    display: "flex",
    background: "grey",
    alignItems: "space-between",
  };
  return (
    <div style={styles}>
      <Link href="/about">
        <button>AboutPage</button>
      </Link>
      <Link href="/contact">
        <a>ContactPage</a>
      </Link>
    </div>
  );
};

export default Navbar;
